USE ecom;
ALTER TABLE events
ADD COLUMN Event_date DATE,
ADD COLUMN Event_time_UTC TIME;
UPDATE events
SET Event_date=LEFT(event_time,10);
UPDATE events
SET Event_time_UTC=MID(event_time,12,8);
SELECT * FROM events;
-- Analysis

/* Month of Sales */
SELECT YEAR(Event_date) AS event_year, MONTH(Event_date) AS event_month, MONTHNAME(Event_date) AS Month_Name,
COUNT(Event_date) AS Net_Sales, SUM(price) AS Total_worth_goods_sold
FROM events
WHERE event_type='purchase'
GROUP BY Event_date
ORDER BY Net_Sales DESC,Total_worth_goods_sold DESC ;

-- January recorded the highest sales, followed by February,November,December and October 

/* Time viewed most */

SELECT HOUR(Event_time_UTC) AS hour_UTC,COUNT(Event_time_UTC) AS number_of_times_viewed
FROM events
WHERE event_type='view' OR event_type='cart'
GROUP BY HOUR(Event_time_UTC)
ORDER BY COUNT(*) DESC
LIMIT 10;

--  11AM UTC is the time when most users browsed or viwed the website

 /* Time purchased most */

SELECT HOUR(Event_time_UTC) AS hour_UTC,COUNT(Event_time_UTC) AS number_of_purchases
FROM events
WHERE event_type='purchase'
GROUP BY HOUR(Event_time_UTC)
ORDER BY COUNT(*) DESC
LIMIT 10;

--  10AM UTC is the time when most users purchased from the website

/*BRANDS SOLD THE MOST*/

SELECT brand,
       COUNT(brand) AS Most_no_of_sales_brand,
	   SUM(price) AS total_worth_goods_sold
FROM events
WHERE event_type='purchase' and brand <>""
GROUP BY brand
ORDER BY Most_no_of_sales_brand DESC
limit 10;

-- Asus is the most purchased brand followed by sirius and amd

/*Category sold the most*/

SELECT category_code,COUNT(category_code) AS number_of_times_sold
FROM events
WHERE event_type='purchase' and category_code<>""
GROUP BY category_code
ORDER BY number_of_times_sold DESC
limit 10;

-- It is found that electronics.telephone category sold the highest number of times 
-- followed stationery cartridge and computer perpherals


/*Frequency of purchase*/

SELECT user_id, 
       COUNT(user_id) AS number_of_times_purchased
FROM events
WHERE event_type="purchase"
GROUP BY user_id
ORDER BY number_of_times_purchased DESC;

-- Highest number of purchases is made by user id 1515915625519490000 which is 12.

/*Number of users purchasing at each time*/
WITH users_purchase_each_time AS
(
SELECT user_id, 
       COUNT(user_id) AS number_of_times_purchased
FROM events
WHERE event_type="purchase"
GROUP BY user_id
ORDER BY number_of_times_purchased DESC
)
SELECT number_of_times_purchased, 
       COUNT(number_of_times_purchased) AS Freq_of_each_purchase
FROM users_purchase_each_time
GROUP BY number_of_times_purchased
ORDER BY Freq_of_each_purchase DESC;

-- It is found that almost 13000 users have purchased only once in the given time span.
 
 /* Actual number of times items purchased after viewing */
SELECT  COUNT(event_type) AS Frequency_of_purchased_event
FROM events e1
WHERE EXISTS(SELECT * FROM events e2 WHERE e1.user_id=e2.user_id AND e1.product_id=e2.product_id 
			 AND e2.event_type='view' AND e1.event_type='purchase');
             
/* Number of times items only viewed */
SELECT  COUNT(event_type) AS Frequency_of_purchased_event
FROM events e1
WHERE EXISTS(SELECT * FROM events e2 WHERE e1.user_id=e2.user_id AND e1.product_id=e2.product_id 
			 AND e2.event_type='view' AND e1.event_type='view');

-- 768093 times items have been viewed , 35726 times items have been purchased after viewing it
-- Purchasing rate is less than 5%
